import React from 'react';
import Arrow from '../../Assets/Arrow.svg';
import './Link.css';

function Link({ to, text, isArrow, isSelected, onClick }) {
    const handleClick = () => {
        onClick(text);
        // Perform navigation programmatically
        // For example, window.location.href = to;
    };

    return (
        <a
            href={text}
            className={`NavLink ${isSelected ? 'selected' : ''}`}
            onClick={handleClick}
        >
            <div className="LinkContent">
                <h4>{text}</h4>
                {isArrow === 'true' && <img src={Arrow} className="Arrow" alt="Arrow" />}
            </div>
            <div className="Underline"></div>
        </a>
    );
}

export default Link;
